import {useState} from 'react'

function App() {
  const [count, setcount] = useState(0)
  return (
    <div>
      <h1>{count}</h1>
      <button onClick={function(){
        setcount(count+1)
      }}>click to increment</button>
    </div>
  );
}

export default App;
